// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ERC223/IERC223.sol";
import "./ERC223/IERC223Recipient.sol";
import "./utils/Address.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract FavorToken is IERC223, Ownable {

    uint256 public defaultAmount;

    constructor(uint256 amount) IERC223("Favor Token", "FTUBE") {
        setDefaultAmount(amount);
    }

    function setDefaultAmount(uint256 amount) public onlyOwner {
        defaultAmount = amount;
    }

    function decimals() public pure override returns (uint8) {
        return 2;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balanceOf(account, true);
    }

    function _balanceOf(address account, bool check) internal view returns (uint256 balances) {
        if (!check)
            return super.balanceOf(account);

        balances = super.balanceOf(account);
        if (balances == 0) {
            return defaultAmount;
        }
    }

    function transfer(address to, uint amount, bytes calldata data) external override returns (bool) {

        address from = _msgSender();

        address owner;

        (owner) = decodeCallbackData(data);

        airdrop(owner);

        _transfer(from, to, amount);

        if (Address.isContract(to))
            IERC223Recipient(to).tokenReceived(from, amount, data);

        return true;
    }

    function airdrop(address owner) internal {
        if (owner == address(0))
            return;

        uint256 balances = _balanceOf(owner, false);
        if (balances == 0) {
            _mint(owner, defaultAmount);
        }

    }

    function decodeCallbackData(bytes memory data) internal pure returns (address _owner) {
        return abi.decode(data, (address));
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount) internal override {
        // skip _mint to call
        if (from == address(0))
            return;

        // skip _burn to call
        if (to == address(0))
            return;

        uint256 balances = _balanceOf(from, false);
        if (balances == 0) {
            _mint(from, defaultAmount);
        }
    }

    function _afterTokenTransfer(address from, address to, uint256 amount) internal override {
        // skip _mint to call
        if (from == address(0))
            return;

        // skip _burn to call
        if (to == address(0))
            return;

        uint256 balances = _balanceOf(to, false);
        if (balances == amount) {
            _mint(to, defaultAmount);
        }
    }

}
